import "./styles.css";
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './App.css';
import Home from './home';
const getLoginPage = () => {
  navigate("https://signin.intra.42.fr/users/sign_in");
}

export default function App() {
  return (
    <div className="App">

      <BrowserRouter>
      <Routes>
        <Route path={"/home"} element = {<Home />}></Route>
      </Routes>
      </BrowserRouter>

    </div>
  );
}

